	begin
	--	clock <= not clock after 200 NS;

	reset <= '1', '0' after 250 NS;

	clk: process
	begin
		clock <= '0';
		wait for 200 ns;
		clock <= '1';
		wait for 200 ns;
	end process clk;	

	sel: process
	begin
		wait until rising_edge(clock);
		sela <= '1';
		selb <= '0';
		wait until rising_edge(clock);
		sela <= '0';
		selb <= '1';
	end process;

