	Gera_entradas: process
	variable v : entrada;
	begin

		for i in test_vector'range loop
			wait until rising_edge(clock);
			v := test_vector(i);
			AB_in <= v.a;
			f3_tmp <= v.b;
			f3_tmp2 <= f3_tmp;
			f3 <= f3_tmp2;
		end loop;

