	end process Gera_entradas;


	process (res, f3, selb)
	begin
		if ((res = f3) or (selb = '0')) then
			ok <= '1';
		else
			ok <= '0';
		end if;
		if (res(30 downto 23) = f3(30 downto 23) or (selb='0')) then
			ok_exp <= '1';
		else
			ok_exp <= '0';
		end if;
	end process;

